description:
Em Huy cùng vợ xây nhà nhưng mới có quyết định được cư trú ở Đức, tháng sau hai vợ chồng sẽ bay nên thiện chí bán nhà Yên Phụ, Tây Hồ ngõ ô tô, tặng toàn bộ nội thất cho chủ mới;
Địa chỉ nhà ở Yên Phụ nhưng có thể vào từ phố Yên Hoa, Vũ Miên, nhà gần hồ, quanh năm mát mẻ, đất rộng, có sân để ô tô, thích hợp cho người không muốn để ô tô trong nhà;
Khu vực Yên Phụ gần phố cổ nên tiện ích không thiếu thứ gì, dân cư văn minh, hàng xóm thân thiện;
Giá có thương lượng và gia lộc cho khách thiện chí.
